def MinSwaps(s1: str, s2: str) -> int:
    if len(s1) != len(s2):
        raise ValueError("Precondition violated: s1 and s2 must have the same length")
    c0 = 0  # count of '01' mismatches
    c1 = 0  # count of '10' mismatches
    for a, b in zip(s1, s2):
        if a != b:
            if a == '0' and b == '1':
                c0 += 1
            elif a == '1' and b == '0':
                c1 += 1
            else:
                # If characters are not '0' or '1', cannot swap to match
                return -1
    if (c0 + c1) % 2 != 0:
        return -1
    # Each pair of (01,10) can be swapped in one move, leftovers (if even) need 2 moves per 2
    return (c0 // 2) + (c1 // 2) + (2 if c0 % 2 == 1 else 0)
