def CheckIP(Ip: str) -> str:
    # Check if the input is a valid IPv4 address in dotted decimal notation
    # An IPv4 address consists of four decimal numbers, each from 0 to 255, separated by dots
    parts = Ip.split('.')
    if len(parts) != 4:
        return "Invalid IP address"
    for part in parts:
        if not part.isdigit():
            return "Invalid IP address"
        # No leading zeros unless the part is exactly '0'
        if len(part) > 1 and part[0] == '0':
            return "Invalid IP address"
        num = int(part)
        if not (0 <= num <= 255):
            return "Invalid IP address"
    return "Valid IP address"
